line = ''''''
signal = [int(i) for i in line]

bp = [0,1,0,-1]

for c in range(100):
    temp = []
    for j in range(len(signal)):
        new_bp = []; sum = 0
        for i in range(len(signal)):
            new_bp += bp[i:i+1] * (j + 1)
        while len(new_bp) < len(signal) + 1:
            new_bp *= 2
        new_bp = new_bp[1:]

        for k in range(len(signal)):
            sum += signal[k] * new_bp[k]
        temp.append(int(str(sum)[-1]))

    signal = temp

for x in range(8):
    print(signal[x], end='')




